import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Task extends Component {
  state = {};

  render() {
    const { task } = this.props;
    return (
      <div className="task-container">
        {task.content}
      </div>
    );
  }
}

Task.propTypes = {
  task: PropTypes.arrayOf(PropTypes.any).isRequired,
};

export default Task;
